/*Table structure for table `t_user` */

DROP TABLE IF EXISTS `t_user`;

CREATE TABLE `t_user` (
  `id` varchar(32) NOT NULL COMMENT '用户ID',
  `userName` varchar(50) DEFAULT NULL COMMENT '用户名',
  `phone` varchar(11) DEFAULT NULL COMMENT '手机号',
  `password` varchar(50) DEFAULT NULL COMMENT '密码',
  `sex` varchar(50) DEFAULT NULL COMMENT '性别 男:man :女 women',
  `status` varchar(50) DEFAULT NULL COMMENT '状态:off:禁用：on 启用',
  `createDate` datetime DEFAULT NULL COMMENT '创建时间',
  `indexUserType` varchar(20) DEFAULT NULL COMMENT '用户当前切换的客户端\n               business B端\n               customer C端',
  `lastLoginDate` datetime DEFAULT NULL COMMENT '最后登录时间',
  `lastLoginIp` varchar(100) DEFAULT NULL COMMENT '最后登录IP',
  `name` varchar(255) DEFAULT NULL COMMENT '真实姓名',
  `deptId` varchar(32) DEFAULT NULL COMMENT '部门Id',
  `email` varchar(100) DEFAULT NULL COMMENT '邮箱',
  `createUser` varchar(32) DEFAULT NULL COMMENT '创建用户',
  `updateDate` datetime DEFAULT NULL COMMENT '修改时间',
  `birth` date DEFAULT NULL COMMENT '出生日期',
  `picId` varchar(32) DEFAULT NULL COMMENT '头像ID',
  `liveAddress` varchar(500) DEFAULT NULL COMMENT '现居地址',
  `hobby` varchar(255) DEFAULT NULL COMMENT '爱好',
  `province` varchar(255) DEFAULT NULL COMMENT '省',
  `city` varchar(255) DEFAULT NULL COMMENT '市',
  `district` varchar(255) DEFAULT NULL COMMENT '区',
  `isSettingPwd` varchar(1) DEFAULT NULL COMMENT '是否设置密码',
  `inviteCode` varchar(6) DEFAULT NULL COMMENT '发送邀请码',
  `acceptCode` varchar(6) DEFAULT NULL COMMENT '接受邀请码',
  PRIMARY KEY (`id`),
  UNIQUE KEY `AK_unique_inviteCode` (`inviteCode`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户表';

