/* Function  structure for function  `getDistance` */

/*!50003 DROP FUNCTION IF EXISTS `getDistance` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `getDistance`(lng1 DECIMAL(20,6),lat1 DECIMAL(20,6),lng2 DECIMAL(20,6),lat2 DECIMAL(20,6)) RETURNS decimal(20,6)
BEGIN
	RETURN ROUND(6378.138 *2*ASIN(SQRT(POW(SIN( (lat1*PI()/180-lat2*PI()/180)/2),2)+COS(lat1*PI()/180)*COS(lat2*PI()/180)* POW(SIN( (lng1*PI()/180-lng2*PI()/180)/2),2)))*1000);
    END */$$
DELIMITER ;

